import Footer from '../components/layout/Footer';
import Header from '../components/layout/Header';
import MainPanel from '../components/MainPanel';

const Panel = (props) => {
  return (
    <>
      <Header />
      <MainPanel />
      <Footer />
    </>
  );
}

export default Panel;
